(12, 1, '2018-12-12 19:08:49', '2018-12-12 21:08:49', '<h2>Descrição</h2>\r\n<ul>\r\n 	<li><strong>Marca:</strong>NZXT</li>\r\n 	<li><strong>Modelo:</strong>CA-PH530-W1</li>\r\n 	<li><strong>Baias:</strong>External 5.25″ x 3Internal 3.5″ /2.5″: 6\r\n\r\nInternal 2.5″: 1 + 6</li>\r\n 	<li><strong>Refrigeração:</strong>Front 2x140mm/ 120mm or 1x200mm(incluso)Rear 1x140mm (incluso 120mm)\r\n\r\nBottom 2x120mm\r\n\r\nSide 1x140mm\r\n\r\nTop 2x200mm/ 140mm or 3x120mm\r\n\r\nInterior 1x120mm/140mm</li>\r\n 	<li><strong>Espaço Interno:</strong>CPU Cooler 183mmVGA Card 282mm (With Cage &amp; Pivot Fan), 310mm (With Cage), 444mm (Without Cage)</li>\r\n 	<li><strong>Cable Management:</strong>26mm (Lowest Point)/ 34mm (Highest Point)</li>\r\n 	<li><strong>Dimensões:</strong>235mm x 572mm x 543mm</li>\r\n 	<li><strong>Material:</strong>Steel, Plastic</li>\r\n 	<li><strong>Suporte a Placas Mãe:</strong>ITX, Micro-ATX, ATX, EATX (322x272mm)</li>\r\n 	<li><strong>Slots de Expanção:</strong>8</li>\r\n 	<li><strong>Externos:</strong>1 x Audio / Mic2 x USB 3.0</li>\r\n 	<li><strong>Controlador de Fan:</strong>Rear IO LED Switch</li>\r\n 	<li><strong>Peso:</strong>10.5 kg</li>\r\n</ul>', 'Gabinete NZXT Phantom 530 – CA-PH530-W1', 'O Phantom 530 apresenta um design novo e elegante, mantendo a sua forma assimétrica clássica; Phantom 530 vem atualizado com recursos altamente solicitados, como uma lateral em acrílico de exibição; Vem com 2 de novo fans padrão da NZXT com design inovador, 120 e 200 milímetros FN V2, com o desempenho atualizado e operação mais silenciosa; Muito espaço para gerenciamento de cabo combinado com sete furos de roteamento e mais de 20 pontos de amarração faz o gerenciamento muito mais clean.', 'publish', 'open', 'closed', '', 'gabinete-nzxt-phantom-530-ca-ph530-w1', '', '', '2018-12-12 19:08:53', '2018-12-12 21:08:53', '', 0, 'http://localhost/ACCIO-STORE/?post_type=product&#038;p=12', 0, 'product', '', 0),
