(14, 1, '2018-12-14 14:40:23', '2018-12-14 16:40:23', '<ul>\r\n 	<li><strong>PESO</strong></li>\r\n 	<li>0.610 Kg</li>\r\n 	<li><strong>PRODUTO SOB ENCOMENDA</strong></li>\r\n 	<li>Sim</li>\r\n 	<li><strong>MARCA</strong></li>\r\n 	<li>Rocco</li>\r\n 	<li><strong>I.S.B.N.</strong></li>\r\n 	<li>9788532522610</li>\r\n 	<li><strong>REFERÊNCIA</strong></li>\r\n 	<li>........</li>\r\n 	<li><strong>ALTURA</strong></li>\r\n 	<li>21.00 cm</li>\r\n 	<li><strong>LARGURA</strong></li>\r\n 	<li>14.00 cm</li>\r\n 	<li><strong>PROFUNDIDADE</strong></li>\r\n 	<li>1.00 cm</li>\r\n 	<li><strong>IDIOMA</strong></li>\r\n 	<li> Português</li>\r\n 	<li><strong>ACABAMENTO</strong></li>\r\n 	<li>Brochura</li>\r\n 	<li><strong>IDADE</strong> <strong>RECOMENDADA</strong></li>\r\n 	<li>Juvenil</li>\r\n 	<li><strong>CÓD.</strong> <strong>BARRAS</strong></li>\r\n 	<li>9788532522610</li>\r\n 	<li><strong>NÚMERO</strong> <strong>DA</strong> <strong>EDIÇÃO</strong></li>\r\n 	<li>1</li>\r\n 	<li><strong>ANO DA EDIÇÃO</strong></li>\r\n 	<li> 2007</li>\r\n 	<li><strong>PAÍS DE ORIGEM </strong></li>\r\n 	<li>Reino Unido</li>\r\n</ul>', 'Harry Potter e as Relíquias da Morte - Livro', 'Harry Potter e as relíquias da morte, de J.K. Rowling, é o sétimo e último livro da série. Voldemorte está cada vez mais forte e Harry Potter precisa encontrar e aniquilar as Horcruxes para enfraquecer o lorde e poder enfrentá-lo. Nessa busca desenfreada, contando apenas com os amigos Rony e Hermione, Harry descobre as Relíquias da Morte, que serão úteis na batalha do bem contra o mal.', 'publish', 'open', 'closed', '', 'harry-potter-e-as-reliquias-da-morte-livro', '', '', '2018-12-14 14:40:27', '2018-12-14 16:40:27', '', 0, 'http://localhost/ACCIO-STORE/?post_type=product&#038;p=14', 0, 'product', '', 0),
