(16, 1, '2018-12-14 14:42:41', '2018-12-14 16:42:41', '<strong>Marca</strong>\r\n\r\nAMD\r\n\r\n<strong>Modelo</strong>\r\n\r\nRyzen 3 1300X\r\n\r\n<strong>Núcleos</strong>\r\n\r\n4\r\n\r\n<strong>Threads</strong>\r\n\r\n4\r\n\r\n<strong>Frequência Base</strong>\r\n\r\n3.5GHz\r\n\r\n<strong>Frequência Avançada</strong>p&gt;3.7GHz\r\n\r\n&nbsp;\r\n\r\n<strong>Total L1 Cache</strong>\r\n\r\n384KB\r\n\r\n<strong>Total L2 Cache</strong>\r\n\r\n2MB\r\n\r\n<strong>Total L3 Cache</strong>\r\n\r\n8MB\r\n\r\n<strong>Desbloqueado</strong>\r\n\r\nSim\r\n\r\n<strong>CMOS</strong>\r\n\r\n14nm\r\n\r\n<strong>Soquete</strong>\r\n\r\nAM4\r\n\r\n<strong>PCI Express</strong>\r\n\r\nPCIe 3.0\r\n\r\n<strong>Refrigeração</strong>\r\n\r\nCooler box Wraith Stealth\r\n\r\n<strong>Consumo</strong>\r\n\r\n65W', 'PROCESSADOR AMD RYZEN 3 QUATRO NUCLEOS CACHE 6MB 3.5GHZ AM4', 'permite descobrir, criar e inovar ainda mais. Com a inteligência artificial AMD SenseMI* e uma eficiente arquitetura recém-projetada, o revolucionário processador AMD Ryzen™ aprende e se adapta para ajudar você a se destacar com incrível agilidade e ter excelente desempenho', 'publish', 'open', 'closed', '', 'processador-amd-ryzen-3-quatro-nucleos-cache-6mb-3-5ghz-am4', '', '', '2018-12-14 14:42:46', '2018-12-14 16:42:46', '', 0, 'http://localhost/ACCIO-STORE/?post_type=product&#038;p=16', 0, 'product', '', 0),
