(18, 1, '2018-12-14 14:47:52', '2018-12-14 16:47:52', '<strong>Marca</strong>\r\nMSI\r\n\r\n<strong>Modelo</strong>\r\nZ170A GAMING M5\r\n\r\n<strong>CPU</strong>\r\nSuporta processadores 6ta Geração Intel® Core&amp;trade i3/i5/i7, e processadores Intel® Pentium® e Celeron® para Socket LGA1151\r\n\r\n<strong>Chipset</strong>\r\nIntel® Z170 Express\r\n\r\n<strong>Memória Principal</strong>\r\n4 slots de memória DDR4 com suporte até 64GB\r\nSuporta DDR4 3600(OC)/ 3200(OC)/ 3000(OC)/ 2800(OC)/ 2600(OC)/ 2400/ 2133 MHz\r\nArquitetura de memória de canal duplo\r\nSuporta memória ECC, unbuffered\r\nSuporta Intel® Extreme Memory Profile (XMP)\r\n\r\n<strong>Slots</strong>\r\n3 slots PCIe 3.0 x16 (suporta modos x16, x8/x8, x8/x8/x4 ou x8/ x8/x1)\r\n4 slots PCIe 3.0 x1\r\n\r\n<strong>Gráficos integrados</strong>\r\n1 porta HDMI™ com suporte para resolução máxima de 4096x2160@24Hz, 2560x1600@60Hz\r\n1 porta DVI-D com suporte para resolução máxima de 1920x1200@60Hz\r\n\r\n<strong>Multi GPU</strong>\r\nSuporta tecnologia de 3 vias AMD® CrossFire™\r\nSuporta tecnologia de 2 vias NVIDIA® SLI™\r\n\r\n<strong>Armazenamento</strong>\r\nChipset Intel® Z170 Express\r\n6 portas SATA 6Gb/s (4 portas reservadas para SATA Express)\r\n2 slots M.2\r\nSuporta PCIe 3.0 x4 e SATA 6Gb/s, SSD M.2 de 4.2cm/ 6cm/ 8cm de comprimento\r\nSuporta PCIe 3.0 x4 NVMe Mini-SAS SSD com Placa Host Turbo U.2\r\n2 portas SATAe (PCIe 3.0 x2)\r\nSuporta tecnologia Intel® Smart Response para processadores Intel Core™\r\n\r\n<strong>RAID</strong>\r\nChipset Intel® Z170 Express\r\nSuporta RAID 0, RAID1, RAID 5 e RAID 10 para dispositivos de armazenamento SATA\r\nSuporta RAID 0 e RAID1 para dispositivos de armazenamento M.2 PCIe*\r\n\r\n<strong>USB</strong>\r\nChipset ASMedia® ASM1142\r\n1 porta USB 3.1 Gen2 (SuperSpeed USB 10Gbps) no painel traseiro\r\n1 porta USB 3.1 Gen2 Tipo C no painel traseiro\r\nChipset Intel® Z170 Express\r\n6 portas USB 3.1 Gen1 (SuperSpeed USB) (4 portas no painel traseiro, 2 portas disponíveis através do conector USB interno)\r\n6 portas USB 2.0 (High-speed USB) (2 portas no painel traseiro, 4 portas disponíveis através de conectores USB internos)\r\n\r\n<strong>Audio</strong>\r\nCodec Realtek® ALC1150\r\nAudio de 7.1 canais de Alta Definição\r\nSuporta saída S/PDIF\r\n\r\n<strong>LAN</strong>\r\n1 controlador Killer™ E2400 Gigabit LAN\r\n\r\n<strong>Conectores internos</strong>\r\n1 conector de energia ATX de 24 pinos\r\n1 conector de energia ATX 12V de 8 pinos\r\n6 conectores SATA 6Gb/s\r\n2 conectores SATAe\r\n2 conectores USB 2.0 (suporta 4 portas USB 2.0 adicionais)\r\n1 conector USB 3.1 Gen1 (suporta 2 portas USB 3.1 Gen1 adicionais)\r\n2 conectores de ventilador CPU de 4 pinos\r\n3 conectores de ventilador de sistema de 4 pinos\r\n1 conector de áudio de painel frontal\r\n2 conectores de painel frontal\r\n1 conector de módulo TPM\r\n1 conector de porta Serial\r\n1 conector para Chassis Intrusion\r\n1 interruptor de modo Lento\r\n1 jumper Clear CMOS\r\n1 LED de 2 dígitos para decodificação de erros\r\n\r\n<strong>Portas traseiras</strong>\r\n1 porta teclado/mouse PS/2\r\n1 portas USB 2.0\r\n1 porta DVI-D\r\n1 porta USB 3.1 Gen2\r\n1 porta USB 3.1 Gen2 Tipo C\r\n4 portas USB 3.1 Gen1\r\n1 porta HDMI™\r\n1 porta LAN (RJ45)\r\n1 conector de saída S/PDIF óptica\r\n5 jacks de áudio OFC\r\n\r\n<strong>BIOS</strong>\r\nO BIOS da placa-mãe tem a função BIOS \"Plug &amp; Play\" que detecta os dispositivos periféricos e placas de expansão automaticamente.\r\n\r\n<strong>Dimensões</strong>\r\nFormato ATX (30.5 cm x 24.4 cm)', 'PLACA MÃE MSI Z170A GAMING M5, DDR4 CHIPSET Z170, LGA 1151', 'Desenvolvida com o ADN de gaming, a rede Killer™ LAN está otimizada para o nível de campeonato online e LAN eSports.\r\n\r\nA nova plataforma de rede Killer E2400 Inteligente, com Advanced Stream Detect 2.0, está construída para o máximo desempenho de rede para os jogos online e streaming de mídia de alta qualidade. Killer™ LAN automaticamente detecta e acelera o tráfego de jogos sobre outros tipos de tráfego de rede para um desempenho de jogo mais suave e sem sobressaltos, oferecendo maior vantagem competitiva.', 'publish', 'open', 'closed', '', 'placa-mae-msi-z170a-gaming-m5-ddr4-chipset-z170-lga-1151', '', '', '2018-12-14 14:48:07', '2018-12-14 16:48:07', '', 0, 'http://localhost/ACCIO-STORE/?post_type=product&#038;p=18', 0, 'product', '', 0),
